await robot.userRequest('服务需求');

await robot.goto('会客厅');

await robot.goto('返回');

const isHuman = await robot.detectHuman();
if(isHuman){
    await robot.speak('您好，请问有什么可以帮助您的吗？');
}else{
    await robot.speak('路上没有遇到人');
}

